import React from 'react'
import Header from './Header'
import {Outlet, useLocation} from 'react-router-dom'
function Layout() {
  const location = useLocation();
  return (
    <>
         {location.pathname==='/'? <Header/>: null}
         <Outlet/>
    </>
  )
}

export default Layout
